import React from 'react';
import {
    BrowserRouter as Router,
    Route, Switch, Link
  } from 'react-router-dom';

  

function About(){
    return(
        <div>
            
            <Switch>
            <Link to="./About.js">About</Link>
        </Switch>
        <Switch>
            <Link to="./Feedback.js">Feedback</Link>
        </Switch>
        <Switch>
            <Link to="/">Home</Link>
        </Switch>


<h1></h1>
        </div>
    )
}
export default About;
